import matplotlib.pyplot as plt
import numpy as np


def plot_it(dataset_name, labels, fscore, baseline, baseline_reporter, number_cells):
    l = np.array(labels)
    l = (l / float(number_cells))
    last = l[len(l) - 1]

    plt.title(dataset_name)
    plt.plot(l, fscore)
    plt.ylabel('F1')
    plt.xlabel('how much of the dataset was labeled')
    plt.plot((0, last), (baseline, baseline), 'k-', color='red')
    plt.text(last / 2, baseline - 0.05, r'baseline reported by ' + baseline_reporter, color='red')
    plt.show()

def plot_it2(dataset_name, labels, fscore, certainty, baseline, baseline_reporter, number_cells):
    l = np.array(labels)
    l = (l / float(number_cells))
    last = l[len(l) - 1]

    fig = plt.figure()
    ax = plt.subplot(111)



    ax.set_title(dataset_name)

    ax.plot(l, fscore, 'blue', label="F1")
    ax.plot(l, certainty, 'orange', label="certainty")

    ax.set_ylabel('percentage')
    ax.set_xlabel('how much of the dataset was labeled')
    ax.plot((0, last), (baseline, baseline), 'k-', color='red')
    ax.text(last / 2, baseline - 0.05, r'baseline reported by ' + baseline_reporter, color='red')

    ax.legend(loc=4)

    plt.show()

def plot_it3(dataset_name, labels, fscore_train, certainty, baseline, baseline_reporter, number_rows, number_cols):
    number_cells = number_rows * number_cols

    l = np.array(labels)
    l = (l / float(number_cells))
    last = l[len(l) - 1]

    rowsl = np.array(labels, dtype=int) / number_cols

    fig = plt.figure()
    ax = plt.subplot(111)
    ax2 = ax.twiny()


    #ax.set_title(dataset_name)

    ax.plot(l, fscore_train, 'blue', label="F1 train")

    if not certainty == None:
        ax.plot(l, certainty, 'orange', label="certainty")

    ax.set_ylabel('percentage')
    ax.set_xlabel('how much of the dataset was labeled')
    ax.plot((0, last), (baseline, baseline), 'k-', color='red')
    ax.text(last / 2, baseline - 0.05, r'baseline reported by ' + baseline_reporter, color='red')

    ax.legend(loc=4)

    ax2.plot(rowsl, fscore_train)  # Create a dummy plot
    ax2.cla()
    plt.show()

def plot_it4(dataset_name, labels, fscore_train, fscore_test, certainty, baseline, baseline_reporter, number_rows, number_cols):
    number_cells = number_rows * number_cols

    l = np.array(labels)
    l = (l / float(number_cells))
    last = l[len(l) - 1]

    rowsl = np.array(labels, dtype=int) / number_cols

    fig = plt.figure()
    ax = plt.subplot(111)
    ax2 = ax.twiny()


    #ax.set_title(dataset_name)

    ax.plot(l, fscore_train, 'blue', label="F1 train")
    ax.plot(l, fscore_test, 'green', label="F1 test")

    if not certainty == None:
        ax.plot(l, certainty, 'orange', label="certainty")

    ax.set_ylabel('percentage')
    ax.set_xlabel('how much of the dataset was labeled')
    ax.plot((0, last), (baseline, baseline), 'k-', color='red')
    ax.text(last / 2, baseline - 0.05, r'baseline reported by ' + baseline_reporter, color='red')

    ax.legend(loc=4)

    ax2.plot(rowsl, fscore_train)  # Create a dummy plot
    ax2.cla()
    plt.show()

def plot_it_time(dataset_name, labels, fscore, certainty, baseline, baseline_reporter, number_rows, number_cols):
    number_cells = number_rows * number_cols

    l = np.array(labels)
    l = (l / float(number_cells))
    last = l[len(l) - 1]

    rowsl = (np.array(labels, dtype=float) * 3.0) / 60.0

    fig = plt.figure()
    ax = plt.subplot(111)
    ax2 = ax.twiny()


    #ax.set_title(dataset_name)

    ax.plot(l, fscore, 'blue', label="F1")

    if not certainty == None:
        ax.plot(l, certainty, 'orange', label="certainty")

    ax.set_ylabel('percentage')
    ax.set_xlabel('how much of the dataset was labeled')
    ax.plot((0, last), (baseline, baseline), 'k-', color='red')
    ax.text(last / 2, baseline - 0.05, r'baseline reported by ' + baseline_reporter, color='red')

    ax.legend(loc=4)

    ax2.plot(rowsl, fscore)  # Create a dummy plot
    ax2.cla()


    plt.show()



def plot_list(list_series, list_names):
    fig = plt.figure()
    ax = plt.subplot(111)

    for i in range(len(list_series)):
        ax.plot(range(len(list_series[i])), list_series[i], label=list_names[i])

    ax.set_ylabel('fscore')
    ax.set_xlabel('round')

    ax.legend(loc=4)

    plt.show()

